class FriendScore 
{ 
public: 
  int highestScore(vector <string> friends) 
  { 
    int res = 0; 
 
    for (int i = 0; i < friends.size(); ++i) 
    { 
      int num = 0; 
      for (int j = 0; j < friends.size(); ++j) 
      { 
        bool isok = false; 
        if (i != j) 
        { 
          if (friends[i][j] == 'Y') 
            isok = true; 
 
          for (int k = 0; k < friends.size(); ++k) 
          { 
            if ((k != i) && (k != j)) 
            { 
              if ((friends[i][k] == 'Y') && (friends[j][k] == 'Y')) 
              { 
                isok = true; 
                break; 
              } 
            } 
          } 
        } 
 
        if (isok) 
          num++; 
      } 
      res = max(res, num); 
    } 
 
    return res; 
  } 
};

